import React from 'react';
import Main from '../main/main';
// import CarDetail from "../../components/Car-Detail/car-detail";
import RelatedCar from "../../components/Related-Car/related-car";
import ListCar from "../../components/listcar/listcar";
import FasterCar from "../../components/FasterCar/FasterCar";
import BrandsSlider from "../../components/BrandsSlider/BrandsSlider.jsx";
import Collabse from "../../components/collabse-list/collabse.jsx";
import Social from "../../components/Social-Media/social-media";
import { useState } from 'react';
// import Location from "../../components/Locations/Locations.jsx"
import FlashSales from '../Flash-Sales/flash-sales.jsx';
import Video from '../video/video.jsx';
import NewCar from '../new-car/new-car.jsx';
import "./home.css"
import ImgSlider from '../main/ImgSlider.jsx';
import Viewer from '../Viewer/Viewer.jsx';

const Home = () => {
  const [language, setLanguage] = useState('en');
  const handleLanguageChange = (lng) => {
    setLanguage(lng);
  };

  return (
    <div className='homeLayout'>
      <div className="container">
        <ImgSlider />
      </div>
      <Viewer />
      <Main />
      <div className='list-brand-list-car'>

        <ListCar />
        <div id='Brands' />

        <BrandsSlider />
      </div>
      {/* ############################    Component img-bar    ############################ */}
      <div className='mg-3'>
        <div className="class-img-bar-lg">
          <a href="#!">
            <img src="/1722177371videobannerchauffeurservice.webp" alt="" />
          </a>
        </div>
        <div className="class-img-bar-sm">
          <a href="#!">
            <img src="/1b.webp" alt="" />
          </a>
        </div>
      </div>
      {/* ****************************    Component img-bar End   **************************** */}
      {/* <CarDetail/> */}
      <RelatedCar />
      <FlashSales />
      {/* ############################    Component img-bar    ############################ */}
      <div className='mg-3'>
        <div className="class-img-bar-lg container">
          <a href="#!">
            <img src="/videobannermonthly.webp" alt="" />
          </a>
        </div>
        <div className="class-img-bar-sm container">
          <a href="#!">
            <img src="/2b.webp" alt="" />
          </a>
        </div>
      </div>
      {/* ****************************    Component img-bar End   **************************** */}
      <NewCar language={language}/>
      <FasterCar />
      <Collabse />
      <Video />
      {/* <Location /> */}
      <Social />

    </div>
  );
}

export default Home;
